Step.SQLStatement:
-- View: adempiere.ftu_ac_status_v
DROP VIEW adempiere.ftu_ac_status_v;
CREATE OR REPLACE VIEW adempiere.ftu_ac_status_v AS SELECT acs.ad_client_id, acs.ad_org_id, acs.created, acs.createdby, acs.updated, acs.updatedby, acs.isactive, acs.ftu_aircraft_id, acs.name, acs.airframetime, acs.acnextmaintdate, acs.acnextmainthrs, acs.acnextmainthrs - acs.airframetime AS timetoinspection, acs.acstatus AS status, dls.snags FROM adempiere.ftu_aircraft acs LEFT JOIN ( SELECT ftu_defectlog.ftu_aircraft_id, count(ftu_defectlog.ftu_defectlog_id) AS snags FROM adempiere.ftu_defectlog WHERE ftu_defectlog.docstatus::text = 'ME'::text GROUP BY ftu_defectlog.ftu_aircraft_id) dls ON acs.ftu_aircraft_id = dls.ftu_aircraft_id ORDER BY acs.acstatus, acs.acnextmainthrs - acs.airframetime;
ALTER TABLE adempiere.ftu_ac_status_v OWNER TO adempiere;

Step.RollbackStatement:
-- View: adempiere.ftu_ac_status_v
DROP VIEW adempiere.ftu_ac_status_v;
CREATE OR REPLACE VIEW adempiere.ftu_ac_status_v AS SELECT acs.ad_client_id, acs.ad_org_id, acs.created, acs.createdby, acs.updated, acs.updatedby, acs.isactive, acs.ftu_aircraft_id, acs.name, acs.airframetime, acs.acnextmaintdate, acs.acnextmainthrs, acs.acnextmainthrs - acs.airframetime AS timetoinspection, CASE WHEN dli.inspect > 0 THEN 'Offline - Inspection'::text WHEN dls.snags > 0 THEN 'U/S'::text ELSE 'Serviceable'::text END AS status, dls.snags FROM adempiere.ftu_aircraft acs LEFT JOIN ( SELECT ftu_defectlog.ftu_aircraft_id, count(ftu_defectlog.ftu_defectlog_id) AS snags FROM adempiere.ftu_defectlog WHERE ftu_defectlog.defectstatus::text = 'U/S'::text GROUP BY ftu_defectlog.ftu_aircraft_id) dls ON acs.ftu_aircraft_id = dls.ftu_aircraft_id LEFT JOIN ( SELECT ftu_defectlog.ftu_aircraft_id, count(ftu_defectlog.ftu_defectlog_id) AS inspect FROM adempiere.ftu_defectlog WHERE ftu_defectlog.defectstatus::text = 'Inspection'::text GROUP BY ftu_defectlog.ftu_aircraft_id) dli ON acs.ftu_aircraft_id = dli.ftu_aircraft_id ORDER BY CASE WHEN dli.inspect > 0 THEN 'Offline - Inspection'::text WHEN dls.snags > 0 THEN 'U/S'::text ELSE 'Serviceable'::text END, acs.acnextmainthrs - acs.airframetime;
ALTER TABLE adempiere.ftu_ac_status_v OWNER TO adempiere;

Step.SQLStatement:
-- View: adempiere.ftu_deferreddefectlist_v
DROP VIEW adempiere.ftu_deferreddefectlist_v;
